import React from "react";
import UserItem from "./UserItem/UserItem";
import axios from 'axios';

const userList = props => {

    let users = [];
    
    axios
        .get('')
        .then(response => {

        })
        .catch(error => {
            console.log(error);
        });

    
    for (let i = 0; i < 5; ++i) {
        users.push(
            <UserItem
                key={i}
                source="https://d1nhio0ox7pgb.cloudfront.net/_img/o_collection_png/green_dark_grey/512x512/plain/user.png"
                name="SampleName"
                age="43"
                country="Ukraine"
                status="user"
            />
        );
    }

    return <div>{users}</div>;
};

export default userList;
